atan :</p><p>Identifikasi kemungknan penyebab hiperglikemia. Identifikasi situasi yang menyebabkan kebutuhan insulin meningkat. Monitor kadar glukosa darah, bila perlu. Monitor tanda dan gejala hiperglikemia (mis, polyuria, polifagia, kelemahan, malaise, pandangan kabur, atau sakit kepala). Monitor intake dan output cairan. Monitor keton urin, kadar analisa gas darah, elektrolit. Kolaborasi pemberian Insulin. Kolaborasi pemberian cairan IV. Identifikasi pengalaman mual. Berikan makan dalam jumlah kecil dan menarik. Kolaborasi pemberian antiemetik, jika perlu.</p><p>Intervensi Kolaborasi :</p><p>- Konsul jantung jawaban (-)</p><p>- Rencana cek urinalisa</p><p>- Rencana cek sputum gram</p><p>- Cek GDP/GD2PP/Hba1c</p><p>- R/ cek ulang AGD post koreksi meylon 1x</p><p>- R/ cek DR ulang tgl 14/3/35</p><p>- Puasa 8 jam NGT alirkan selanjutnya MC 6x120 cc</p><p><br></p><p><br></p>', NULL, '1664', 0, NULL, '2025-03-12 12:15:59')
