ERROR - 2025-03-12 12:16:56 --> Query error: ERROR:  invalid byte sequence for encoding "UTF8": 0xde 0x6e - Invalid query: INSERT INTO "sm_cppt" ("id_layanan_pendaftaran", "waktu", "id_profesi", "subject", "objective", "assessment", "plan", "ademi_assesment", "ademi_diag", "ademi_interv", "ademi_monev", "sbar_situation", "sbar_background", "sbar_assesment", "sbar_recommend", "id_nadis", "ttd_nadis", "instruksi_ppa", "id_dokter_dpjp", "id_user", "konsul_via_telp", "konsul", "created_date") VALUES ('709317', '2025-03-12 11:54', '18', 'pasien mengatakan lemas, mual (+) muntah tidak ada', 'A: Jalan nafas paten B: RR 19 x/menit, SpO2 100ngan NK 3 lpm, pengembangan dada simetris, retraksi dada (-), rhonki -/-, wheezing -/-. C: TD 138/83 mmHg (MAP 108), Nadi 95 x/menit, akral hangat, nadi teraba kuat, CRT &lt; 3 detik, Tgl 12/3/25 terpasang IVFD di TAKA no 22 Nacl 0.9 persen 500cc/ 8 jam threeway dengan Insulin Drip 4 ui/jam. Tgl 12/3/25 terpasang IVFD di TAKI Nacl 0.9 persen 400cc + Meylon 100 meq/ 8 jam.  D : Kesadaran CM GCS 15, E4M6V5, kekuatan otot 5/5/5/5, pupil isokor 2/2, RC +/+. E: Suhu 36,4 C dekubitus tidak ada, Tgl 12/3/25 terpasang DC no 16 di uretra, produksi warna kuning jernih, diuresis  cc/kgbb/jam, Hasil Lab: Hb 15.5 Ht 49 Leukosit 19.100 GDS 658. pH 7,158 pCO2 13.2 pO2 121 BE -24.2 HCO3 5 O2 saturasi 97.7%. Na 130 K 5.2 Cl 97. Keton darah 3.2', 'Ketidakstabilan Kadar Glukosa darah, Nausea', 'Setelah dilakukan tindakan keperawatan selama 3x24 jam diharapkan Kestabilan kadar glukosa darah meningkat dengan Kriteria Hasil : Koordinasi meningkat, Mengantuk menurun, Pusing menurun, Lelah/lesu menurun, Mulut kering menurun, Rasa haus menurun, Kadar glukosa dalam darah membaik. Setelah dilakukan tindakan keperawatan selama 2x24 jam diharapkan Tingkat Nausea Menurun dengan Kriteria Hasil : Nafsu makan meningkat, Keluhan mual menurun, Perasaan ingin muntah menurun, Perasaan asam dimulut menurun.', '', '', '', '', '', '', '', '', '1664', '1', '<p>Intervensi Keperawatan :</p><p>Identifikasi kemungknan penyebab hiperglikemia. Identifikasi situasi yang menyebabkan kebutuhan insulin meningkat. Monitor kadar glukosa darah, bila perlu. Monitor tanda dan gejala hiperglikemia (mis, polyuria, polifagia, kelemahan, malaise, pandangan kabur, atau sakit kepala). Monitor intake dan output cairan. Monitor keton urin, kadar analisa gas darah, elektrolit. Kolaborasi pemberian Insulin. Kolaborasi pemberian cairan IV. Identifikasi pengalaman mual. Berikan makan dalam jumlah kecil dan menarik. Kolaborasi pemberian antiemetik, jika perlu.</p><p>Intervensi Kolaborasi :</p><p>- Konsul jantung jawaban (-)</p><p>- Rencana cek urinalisa</p><p>- Rencana cek sputum gram</p><p>- Cek GDP/GD2PP/Hba1c</p><p>- R/ cek ulang AGD post koreksi meylon 1x</p><p>- R/ cek DR ulang tgl 14/3/35</p><p>- Puasa 8 jam NGT alirkan selanjutnya MC 6x120 cc</p><p><br></p><p><br></p>', NULL, '1664', 0, NULL, '2025-03-12 12:16:56')
